import React from 'react';
import {BrowserRouter, Route, Routes} from 'react-router-dom';
import {NotFound, Dashboard} from './pages';

const App = () => {
  return (
    <div >
      <BrowserRouter>
      <Routes>
        <Route path='/dashboard' component={Dashboard} />
        <Route component={NotFound}/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}
